import React, { useEffect, useState } from "react";

const Home = () => {
    const [isDark, setDark] = useState(false);

    const toggleDarkMode = () => {
        setDark(!isDark);
    };

    useEffect(() => {
        if (isDark) {
            document.documentElement.classList.add('dark');
        } else {
            document.documentElement.classList.remove('dark');
        }
    }, [isDark]);


    return (
        <main className="p-5">
            <h1>
                Hello world!
            </h1>
        </main>
    );
};

export default Home;
